export default function TableRow(props) {
  const formatter = new Intl.NumberFormat("en-IN", {
    style: "Curreny",
  });
  return (
    <tbody>
      <tr>
        <td>{props.yearInfo.year}</td>
        <td>{props.yearInfo.savingsEndOfYear}</td>
        <td>{props.yearInfo.yearlyInterest}</td>
        <td>{props.yearInfo.totalInterest}</td>
        <td>{props.yearInfo.investedCapital}</td>
      </tr>
    </tbody>
  );
}
